import React, { Component } from "react";
import "./NumberList";
import App from './../App'

class NumberList extends Component {

  renderCalculation = ({ id, calc }) => {
    return <li key={id}>{calc}</li>;
  };
  render() {



    let calcArray = this.props.calculationArray;

    const calcItems = calcArray.slice(0).reverse().map(this.renderCalculation);

    return <ul>{calcItems}</ul>;
  }
}

export default NumberList;
